# Test generated by RoostGPT for test roost-test using AI Type Open AI and AI Model gpt-4

import calculate
import unittest

class TestCalculate(unittest.TestCase):

    def test_judge_leap_year(self):
        # Test for a leap year
        result = calculate.judge_leap_year(2000)
        self.assertEqual(result, True)

        # Test for a non-leap year
        result = calculate.judge_leap_year(2001)
        self.assertEqual(result, False)

        # Test for a year divisible by 100 but not by 400
        result = calculate.judge_leap_year(1900)
        self.assertEqual(result, False)

        # Test for a year divisible by 4 but not by 100
        result = calculate.judge_leap_year(2004)
        self.assertEqual(result, True)

if __name__ == '__main__':
    unittest.main()
